    return (
        <div>
            <Head>
                <title>Node Bird</title>
                <link rel="stylesheet" href="https://cdnjs.cloudfare.com/ajax/libs/antd/3.16.2/antd.css"></link>
                <script src="https://cdnjs.cloudfare.com/ajax/libs/antd/3.16.2/antd.js"></script>
            </Head>
            <AppLayout>
                <Link href="/about"><a>about</a></Link>
                <div>Thank you Next!</div>
            </AppLayout>
        </div>
    );
};

export default Home;
